import Server from "./Server";
import { serversData } from '../data';
import { serverLists } from '../GetServers';

function ServerList() {
  //const sorted = serversData.sort( () => )
  return (
    <div className="ServerList">
      <table className="table table-hover">
        <thead>
          <tr className="text-uppercase table-header">
            <th scope="col">Server</th>
            <th scope="col">Distance</th>
          </tr>
        </thead>
        <tbody>
          {serversData.map((server) => {
            return(
            <Server name={server.name} distance={server.distance}></Server>

            )
          })}
        </tbody>
      </table>
    </div>
  );
}

export default ServerList;
